%spark

// Zeppelin creates and injects sc (SparkContext) and sqlContext (HiveContext or SqlContext)
// import org.apache.spark.sql.functions._

// removed the header row
val property = sc.textFile("file:///home/pitt/mke_data/MPROP2005DEC.csv")
val propertyHeader = property.first() 
val propertyData = property.filter( line => line !=propertyHeader)


// this is used to implicitly convert an RDD to a DataFrame.
case class Property(propId: String, propValue: Int, propType: String, neighborhood: String, basement: String, attic: String, bldgArea: String, age: Int, numFireplace: String, ac: String, bedroom: String, bathroom: String, halfBath: String, parkingType: String, lotArea: String )


// load the relevant data for the 2005 data
val property = propertyData.map(_.split(",(?=([^\"]*\"[^\"]*\")*[^\"]*$)")).map(p => Property(p(0).toString,p(16).trim.toInt,p(12),p(45).toString,p(51),p(52),p(54),(2007-p(55).trim.toInt),p(57),p(58),p(60),p(61),p(62),p(64),p(65))).toDF()

property.registerTempTable("property2005")
